import React from 'react';


const Rectangle = (props) => {
    console.log({...props}.topRow);
    return(
        <div className='absolute flex flex-wrap justify-center shadow-1 ' style={{top: (props.topRow) , bottom: props.bottomRow, right: props.rightCol, left: props.leftCol}}>

        </div>
    );
}
export default Rectangle;
